        # 目前区分content的两种数据：
        # - "b_total"：商户维度聚合数据，（分城市消费者统计数据），相关商家属性。
        # - "c_deposit"：C类个人充值数据，未来扩展C类核销，退款等数据类型，"c_"前缀。
        # - "c_total"：C类个人充值数据聚合(安心充+学费码整体去重按照地理位置维度聚合)
